// gate.js (NO pongas <script> aquí)
// gate.js — activa index.html solo del 26 al 28 de noviembre (inclusive) en UTC-06:00
(function () {
  const TZ = '-06:00'; // Costa Rica
  // Abre 26/11 00:00 y cierra 29/11 00:00 (para incluir todo el día 28)
  const OPEN_FROM = new Date(`2025-11-14T08:00:00${TZ}`);
  const OPEN_UNTIL = new Date(`2025-11-29T00:00:00${TZ}`); // exclusivo

  const now = new Date();
  const isOpen = now >= OPEN_FROM && now < OPEN_UNTIL;

  // Si ya está dentro de la ventana, ir a la página de resultados
  if (isOpen) {
    window.location.replace('index1.html');
  }
})();

/* ========= Configuración ========= */
const RELEASE_AT = '2025-11-14T08:00:00-06:00'; // FECHA/HORA DE PUBLICACIÓN
const TARGET_URL = 'index1.html';                 // A dónde redirigir al habilitar

/* Pega aquí tu Base64 del banner si lo usas. Si lo dejas vacío, puedes
   usar <img id="banner" src="banner.png"> en el HTML en su lugar. */
const logoBase64 = 'data:image/png;base64,';// <-- pega tu cadena base64 aquí


/* ========= Inicialización ========= */
const bannerImg = document.getElementById('banner');
if (logoBase64) bannerImg.src = logoBase64;

const releaseText = document.getElementById('releaseText');
const d = new Date(RELEASE_AT);
releaseText.textContent = isNaN(d.getTime()) ? RELEASE_AT : d.toLocaleString();

const dEl = document.getElementById('cdDays');
const hEl = document.getElementById('cdHours');
const mEl = document.getElementById('cdMins');
const sEl = document.getElementById('cdSecs');




function updateCountdown(){
  const now = new Date();
  const goal = new Date(RELEASE_AT);
  if (isNaN(goal.getTime())){
    dEl.textContent = hEl.textContent = mEl.textContent = sEl.textContent = '--';
    return;
  }

  const diff = goal - now;
  if (diff <= 0){
    window.location.href = TARGET_URL;
    return;
  }

  const sec = Math.floor(diff / 1000);
  const days = Math.floor(sec / 86400);
  const hours = Math.floor((sec % 86400) / 3600);
  const mins = Math.floor((sec % 3600) / 60);
  const secs = sec % 60;

  dEl.textContent = String(days);
  hEl.textContent = String(hours).padStart(2, '0');
  mEl.textContent = String(mins).padStart(2, '0');
  sEl.textContent = String(secs).padStart(2, '0');
}

updateCountdown();
setInterval(updateCountdown, 1000);


